import './App.css';

class MyComponent extends React.Component {
    render() {
        return (
            <div>
                <h1>Ageu Menezes Costa</h1>
                <p>Olá, sou estudante de desenvolvimento Web na Trybe<br></br>
                    e estou iniciando o módulo de Front-end<br></br>
                    aprendendo React.<br></br><br></br>
                    Aqui eu criei o meu primeiro componente React!!</p>
            </div>
        )
    }
}

export default MyComponent;
